import React, { useState, useEffect, useContext, useRef } from "react";
import $ from "jquery";
import ShareLink from 'react-facebook-share-link';
import TwitterLink from 'react-twitter-share-link'
import Snackbar from '@material-ui/core/Snackbar';
import Skeleton from '@material-ui/lab/Skeleton';
import MuiAlert from '@material-ui/lab/Alert';
import 'react-dropzone-uploader/dist/styles.css';
import Dropzone from "react-dropzone";
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import Switch from "react-switch";
import Button from '@material-ui/core/Button';
import SaveIcon from '@material-ui/icons/Save';
import { confirmAlert } from 'react-confirm-alert';
import 'react-confirm-alert/src/react-confirm-alert.css';
import CancelIcon from '@material-ui/icons/Cancel';
import banner from "../../../images/vtc-banner.jpg";
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import Footer from "../../../components/Footer/AgentFooter";
import AgentHeader from "../Header/AgentHeader";
import axios from "axios";
import { Link, useHistory } from "react-router-dom";
import { AuthContext } from "../../../CommonMethods/Authentication";
import { APIURL, APIPath } from "../../../CommonMethods/Fetch";
import { postRecord } from "../../../CommonMethods/Save";
import ReactPaginate from 'react-paginate';
import noimage from "../../../images/no0img.jpg";
import { makeStyles } from '@material-ui/core/styles';
import { object } from "prop-types";
const APIGetUserData = APIURL() + "user-details";
const APIGetCountries = APIURL() + "get-countries";
const APIGetStates = APIURL() + "get-states";
const APIGetImagesetList = APIURL() + "get-imagesetlist";
const APIChangeService = APIURL() + "change-tour-service";
const APIDeleteImageset = APIURL() + "delete-imageset";
const APIChangeStatus = APIURL() + "change-status";
const APIActivate = APIURL() + "change-image-status";
const APISchedule = APIURL() + "change-schedule-status";
const APIDuplicate = APIURL() + "duplicateimageset";
const APITourService = APIURL() + "tourservicelink";
const APIOtherLink = APIURL() + "tourotherlink";
const APIVideoPromotion = APIURL() + "load-video-promotion";
const APIUpdateVideoPromotion = APIURL() + "update-promotions";
const APIServiceMail = APIURL() + "tour-send-mail";
const APIOtherMail = APIURL() + "other-link-send-email";
const APIDistributeTour = APIURL() + "distribute-tour";
const APIUpdateDistributeTour = APIURL() + "update-distribute-tour";
const APISaveDistributeSetting = APIURL() + "save-distribute-settings";
const APIGetSaveTour = APIURL() + "get-saveTourorder";
const APILoadDomainManager = APIURL() + "get-loadDomainmanager";
const APILoadCraigList = APIURL() + "load-craiglist-modal";
const APIDomainExtension = APIURL() + "domain-extension";
const APIActiveTours = APIURL() + "active-tours";
const APIDomainSearch = APIURL() + "domain-search";
const APILoadTrafficReport = APIURL() + "load-trafficReport";
const APISaveTrafficReport = APIURL() + "save-trafficReport";
const APISendMail = APIURL() + "send-TrafficReport";
const APIDomainOrder = APIURL() + "agent-domain-order";
function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const useStyles = makeStyles((theme) => ({
    backdrop: {
        zIndex: theme.zIndex.drawer + 9999,
        color: '#fff',
    },
}));

export default function AgentImageSets() {
    const initialImagesetState = {
        countryid: 40,
        stateid: "",
        city: "",
        categoryid: "",
        typeid: "",
        caption: "",
        pricetype: "",
        price: "",
        mls: "",
        virtualtourservice: 1,
        flyerservice: 1,
        videoservice: 1,
        picture: "",
        video: "",
        panorama: ""
    }
    const initialDomainOrderState = {
        authenticate_key: "abcd123XYZ",
        agent_id: "",
        tour_id: "",
        domainname: "",
        domain: "",
        ccno: "",
        cvv: "",
        exp_month: "",
        exp_year: "",
        amount: "25"
    }
    let history = useHistory();
    const classes = useStyles();
    const { dispatch } = useContext(AuthContext);
    const context = useContext(AuthContext);
    const [currentUser, setCurrentUser] = useState({});
    const [openModal, setOpenModal] = useState(false);
    const [maxWidth, setMaxWidth] = React.useState('lg');
    const [checked, setChecked] = useState(false);
    const [allCountries, setAllCountries] = useState([]);
    const [imagesetList, setImagesetList] = useState([]);
    const [allStates, setAllStates] = useState([]);
    const [imagesetData, setImagesetData] = useState(initialImagesetState);
    const [openError, setOpenError] = useState(false);
    const [openSuccess, setOpenSuccess] = useState(false);
    const [message, setMessage] = useState("");
    const [select, setSelect] = useState(false);
    const [openServiceModal, setOpenServiceModal] = useState(false);
    const [openOtherLinkModal, setOpenOtherLinkModal] = useState(false);
    const [id, setId] = useState("");
    const [openWarning, setOpenWarning] = useState(false);
    const [element, setElement] = useState("");
    const [serviceLinks, setServiceLinks] = useState({});
    const [otherLink, setOtherLink] = useState({});
    const [distributeTourLink, setDistributeTourLink] = useState({});
    const [sync, setSync] = useState(true);
    const [openVideoPromoModal, setOpenVideoPromoModal] = useState(false);
    const [videoPromoData, setVideoPromoData] = useState({});
    const [openTrafficModal, setOpenTrafficModal] = useState(false);
    const [openDistributeModal, setOpenDistributeModal] = useState(false);
    const [distributeVideoChecked, setDistributeVideoChecked] = useState(false);
    const [orderByData, setOrderByData] = useState({});
    const [open, setOpen] = useState(false);
    const [refresh, setRefresh] = useState(true);
    const [craigeListOpen, setCraigeListOpen] = useState("")
    const [domainData, setDomainData] = useState([]);
    const [offset, setOffset] = useState(0);
    const [postPerPage] = useState(6);
    const [pageCount, setPageCount] = useState(0);
    const [allData, setAllData] = useState([]);
    const [totalData, setTotalData] = useState([]);
    const [openCraiglist, setOpenPostCraiglist] = useState(false);
    const [craiglistData, setCraiglistData] = useState("")
    const [extensionName, setExtensionName] = useState([]);
    const [activeTour, setActiveTour] = useState([]);
    const [DomainName, setDomainName] = useState("");
    const [DomainExtension, setDomainExtension] = useState("");
    const [countryData, setCountryData] = useState([]);
    const [trafficData, setTrafficdata] = useState("");
    const [uploadedImages, setUploadedImages] = useState([]);
    const [uploadedVideos, setUploadedVideos] = useState([]);
    const [uploadedPanorama, setUploadedPanorama] = useState([]);
    const [domainOrderData, setDomainOrderData] = useState(initialDomainOrderState);
    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetUserData, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setCurrentUser(res.data[0].response.data.agent_profile);
                        // setCurrentEmail(res.data[0].response.data.agent_profile.email);
                    }
                });
        }
    }, [context.state.user]);
    const onDrop = React.useCallback(acceptedFiles => {
        acceptedFiles.forEach(res => {
            setUploadedImages(oldArray => [...oldArray, res]);
        })
    }, [])
    const onDropVideo = React.useCallback(acceptedFiles => {
        acceptedFiles.forEach(res => {
            setUploadedImages(oldArray => [...oldArray, res]);
        })
    }, [])
    // const { getRootProps, getInputProps, isDragActive } = useDropzone({
    //     onDrop, accept: {
    //         'image/jpeg': [],
    //         'image/png': [],
    //         'video/*': [],
    //     }
    // })
    // const { getRootPropsVideo, getInputPropsVideo, isDragActiveVideo } = useDropzone({
    //     onDropVideo, accept: {
    //         'video/*': [],
    //     }
    // })
    const handleImageRemove = (data) => {
        const filteredPeople = uploadedImages.filter((item) => item.name !== data.name);
        setUploadedImages(filteredPeople);
    }
    const handleVideoRemove = (data) => {
        const filteredPeople = uploadedVideos.filter((item) => item.name !== data.name);
        setUploadedVideos(filteredPeople);
    }
    const handlePanoramaRemove = (data) => {
        const filteredPeople = uploadedPanorama.filter((item) => item.name !== data.name);
        setUploadedPanorama(filteredPeople);
    }
    useEffect(() => {
        $(".gee_cross").hide();
        $(".gee_menu").hide();
    }, []);
    const ShowMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_hamburger").hide();
            $(".gee_cross").show();
        });
    }
    const HideMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_cross").hide();
            $(".gee_hamburger").show();
        });
    }

    useEffect(() => {
        const objusr = { authenticate_key: "abcd123XYZ" };
        postRecord(APIGetCountries, objusr)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setAllCountries(res.data[0].response.data);
                }
            });
    }, []);
    useEffect(() => {
        const objusr = {
            authenticate_key: "abcd123XYZ",
            country_id: imagesetData.countryid
        };
        postRecord(APIGetStates, objusr)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setAllStates(res.data[0].response.data);
                }
            });
    }, [imagesetData.countryid]);
    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetImagesetList, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setImagesetList(res.data[0].response.data);
                        setOrderByData(res.data[0].response.orderby)
                    }
                });
        }
    }, [context.state.user, sync]);
    useEffect(() => {
        if (imagesetList.length > 0) {
            filterData();
        }
    }, [offset, imagesetList]);

    useEffect(() => {
        const objuser = { authenticate_key: "abcd123XYZ" }
        postRecord(APIDomainExtension, objuser)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setExtensionName(res.data[0].response.data);
                }
            });
    }, [])
    useEffect(() => {
        const objuser = { authenticate_key: "abcd123XYZ", tourId: id }
        postRecord(APILoadTrafficReport, objuser)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setTrafficdata(res.data[0].response.data);
                }
            });
    }, [id]);

    useEffect(() => {
        if (context.state.user) {
            const objuser = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId }
            postRecord(APIActiveTours, objuser)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setActiveTour(res.data[0].response.data)
                    }
                })
        }
    }, [context.state.user])
    useEffect(() => {
        setTimeout(() => {
            setRefresh(false);
        }, 2000)
    }, [allData])
    const filterData = async () => {
        const endOffset = offset + postPerPage;
        setTotalData(imagesetList.slice(offset, endOffset));
        setAllData(imagesetList.slice(offset, endOffset));
        setPageCount(Math.ceil(imagesetList.length / postPerPage));
        // const slice = imagesetList.slice(offset - 1, offset - 1 + 6);
        // setTotalData(slice);
        // setAllData(slice);
        // setPageCount(Math.ceil(imagesetList.length / postPerPage));
    }
    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenError(false);
        setOpenSuccess(false);
        setOpenWarning(false);
    };
    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setImagesetData({ ...imagesetData, [name]: value });
    };
    const handleServiceInputChange = (event) => {
        const { name, value } = event.target;
        setServiceLinks({ ...serviceLinks, [name]: value });
    };
    const handleOtherInputChange = (event) => {
        const { name, value } = event.target;
        setOtherLink({ ...otherLink, [name]: value });
    };
    const handleTourChange = nextChecked => {
        setImagesetData({ ...imagesetData, ["virtualtourservice"]: nextChecked === true ? 1 : 0 });
    };
    const handleFlyerChange = nextChecked => {
        setImagesetData({ ...imagesetData, ["flyerservice"]: nextChecked === true ? 1 : 0 });
    };
    const handleVideoChange = nextChecked => {
        setImagesetData({ ...imagesetData, ["videoservice"]: nextChecked === true ? 1 : 0 });
    };
    const getUploadParams = ({ meta }) => {
        return { url: 'https://httpbin.org/post' }
    };
    const handleChangeStatus = ({ meta, file }, status) => {
        // data.push(file);
        setImagesetData({ ...imagesetData, ["picture"]: file });
    };

    const handleImageSubmit = (files, allFiles) => {
        const data = [];
        files.map(res => {
            data.push(res.file);
        })
        setImagesetData({ ...imagesetData, ["picture"]: data });
        allFiles.forEach(f => f.remove())
        setMessage("Image Uploaded Successfully");
        setOpenSuccess(true);
        setUploadedImages(data);
    }
    const getImageFromUpload = (data) => {
        return URL.createObjectURL(data);
    }
    const handleVideoSubmit = (files, allFiles) => {
        const data = [];
        files.map(res => {
            data.push(res.file);
        })
        setImagesetData({ ...imagesetData, ["video"]: data });
        allFiles.forEach(f => f.remove())
    }
    const handleMailChange = (event) => {
        const { value } = event.target;
        setTrafficdata({ ...trafficData, ["reportrecipients"]: value })
    }
    const handleMailStatusChange = (event) => {
        setTrafficdata({ ...trafficData, ["weekly_status"]: event === true ? 1 : 0 })
    }
    const handlePanoramaSubmit = (files, allFiles) => {
        const data = [];
        files.map(res => {
            data.push(res.file);
        })
        setImagesetData({ ...imagesetData, ["panorama"]: data });
        allFiles.forEach(f => f.remove())
        setUploadedImages(data);
    }
    const saveImageset = (data) => {
        if (uploadedImages.length !== 0 || uploadedVideos.length !== 0 || uploadedPanorama.length !== 0) {
            setOpen(true);
            data.authenticate_key = "abcd123XYZ";
            data.agent_id = JSON.parse(context.state.user).agentId;
            data.caption = imagesetData.caption;
            data.picture = uploadedImages;
            data.video = uploadedVideos;
            data.panorama = uploadedPanorama;
            const formData = new FormData();
            for (let i in data) {
                if (i === 'picture') {
                    for (let file of data[i]) {
                        formData.append('picture[]', file);
                    }
                }
                else if (i === 'panorama') {
                    for (let file of data[i]) {
                        formData.append('panorama[]', file);
                    }
                }
                else if (i === 'video') {
                    for (let file of data[i]) {
                        formData.append('video[]', file);
                    }
                }
                else {
                    formData.append(i, data[i])
                }
            }
            axios
                .post(APIURL() + `agent-save-imageset`, formData, {})
                .then(res => {
                    setOpen(false);
                    if (res.data[0].response.status === "success") {
                        setMessage(res.data[0].response.message);
                        setOpenSuccess(true);
                        setSync(true);
                        setOpenModal(false);
                        setUploadedImages([]);
                        setImagesetData(initialImagesetState);
                    }
                    else {
                        setMessage(res.data[0].response.message);
                        setOpenError(true);
                        setSync(true);
                    }
                    setSync(false);
                }).catch(err => {
                    setMessage("Something Went Wrong. Please try again later...");
                    setOpenError(true);
                    setOpen(false);
                });
        }
        else {
            setMessage("Please Upload images / videos first to submit the form ...");
            setOpenWarning(true);
        }

    }
    const handleEditImageset = (data) => {
        history.push(APIPath() + "edit-image-set/" + data.id);
    }
    const handleImageSetId = (data) => {
        var div = document.getElementById("myDiv" + data.id);
        if (element !== "") {
            element.classList.remove("active");
        }
        if (element === div) {
            div.classList.remove("active");
            setElement("");
            setId("");
        }
        else {
            div.classList.add("active");
            setElement(div);
            setId(data.id);
        }
    }
    const handleTourServiceChange = (event, tid) => {
        //var check = data.virtualtourservice === 1 ? 0 : 1;
        setOpen(true);
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, status: "tour", virtualtourservice: event, tourid: tid };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setOpen(false);
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleFlyerServiceChange = (event, tid) => {
        setOpen(true);
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, status: "flyer", flyerservice: event };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setOpen(false);
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleVideoServiceChange = (event, tid) => {
        //var check = data.videoservice === 1 ? 0 : 1;
        setOpen(true);
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, status: "video", videoservice: event };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setOpen(false);
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleDelete = (id) => {
        confirmAlert({
            message: 'Are you sure you want to delete this imageset ? ',
            buttons: [
                {
                    label: 'Yes',
                    onClick: () => {
                        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourId: id };
                        postRecord(APIDeleteImageset, obj)
                            .then(res => {
                                if (res.data[0].response.status === "success") {
                                    setMessage(res.data[0].response.message);
                                    setOpenSuccess(true);
                                    setSync(false);
                                }
                                else {
                                    setMessage(res.data[0].response.message);
                                    setOpenError(true);
                                    setSync(false);
                                }
                                setSync(true);
                            });
                    }
                },
                {
                    label: 'No',
                    onClick: () => {

                    }
                }
            ]
        });
    }

    const handleStatusChange = (event) => {
        let Tour = document.getElementById("statusId");
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: Tour.value, opt: event.target.value };
        postRecord(APIChangeStatus, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleActivateChange = (event, tid) => {
        // var check = event === false ? 0 : 1;
        setOpen(true);
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, isactive: event };
        postRecord(APIActivate, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setOpen(false);
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleScheduleChange = (event, tid) => {
        setOpen(true);
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tid, is_schedule: event === true ? 1 : 0 };
        postRecord(APISchedule, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setOpen(false);
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const downloadQrCode = (image) => {

        toDataURL(image, function (dataUrl) {
            var link = document.createElement('a');
            link.href = dataUrl;
            link.setAttribute("download", "image.jpg");
            document.body.appendChild(link);
            link.click();
        });
    }
    function toDataURL(url, callback) {
        var xhr = new XMLHttpRequest();
        xhr.onload = function () {
            var reader = new FileReader();
            reader.onloadend = function () {
                callback(reader.result);
            }
            reader.readAsDataURL(xhr.response);
        };
        xhr.open('GET', url);
        xhr.responseType = 'blob';
        xhr.send();
    }
    const handleDuplicate = () => {
        if (id === "") {
            setMessage("Please select one imageset");
            setOpenError(true);
        }
        else {
            setOpen(true);
            const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourId: id };
            postRecord(APIDuplicate, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setMessage(res.data[0].response.message);
                        setOpenSuccess(true);
                        setSync(false);
                        setOpen(false);
                    }
                    else {
                        setMessage(res.data[0].response.message);
