                                                    <input type="radio" name="radio1" id="radio3" value="option3" />
                                                    <label for="radio3">Specify Site </label>
                                                </span>
                                            </div>
                                        </div>
                                        <div class="row">
                                            <div class="col-lg-12">
                                                <input type="text" name="" placeholder="" class="form-control" />
                                            </div>
                                        </div>
                                    </div>

                                    <div class="agent_pop_main_head" style={{ paddingTop: "15px" }}>
                                        <h5>Checkout Details</h5>
                                    </div>
                                    <div class="row" style={{ paddingTop: "10px" }}>
                                        <div class="col-lg-6">
                                            <label>Credit Card Number<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <input type="text" name="ccno" value={domainOrderData.ccno} onChange={handlePaymentCardNoChange} placeholder="" class="form-control" />
                                        </div>
                                        <div class="col-lg-6">
                                            <label>CVV<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <input type="text" name="cvv" value={domainOrderData.cvv} onChange={handlePaymentPhoneChange} placeholder="" class="form-control" maxLength="3" />
                                        </div>
                                    </div>
                                    <div class="row" style={{ paddingTop: "10px" }}>
                                        <div class="col-lg-4">
                                            <label>Expiration Date<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <select class="form-control" name="exp_month" value={domainOrderData.exp_month} onChange={handleDomainOrderChange}>
                                                <option value="0">Select Month</option>
                                                <option value="01">January</option>
                                                <option value="02">February</option>
                                                <option value="03">March</option>
                                                <option value="04">April</option>
                                                <option value="05">May</option>
                                                <option value="06">June</option>
                                                <option value="07">July</option>
                                                <option value="08">August</option>
                                                <option value="09">September</option>
                                                <option value="10">October</option>
                                                <option value="11">November</option>
                                                <option value="12">December</option>
                                            </select>
                                        </div>
                                        <div class="col-lg-4">
                                            <label>Select Year<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <select class="form-control" name="exp_year" value={domainOrderData.exp_year} onChange={handleDomainOrderChange}>
                                                <option value="0">Select Year</option>
                                                <option value="2022">2022</option>
                                                <option value="2023">2023</option>
                                                <option value="2024">2024</option>
                                                <option value="2025">2025</option>
                                                <option value="2026">2026</option>
                                                <option value="2027">2027</option>
                                                <option value="2028">2028</option>
                                                <option value="2029">2029</option>
                                                <option value="2030">2030</option>
                                                <option value="2031">2031</option>
                                                <option value="2032">2032</option>
                                            </select> </div>
                                        <div class="col-lg-4">
                                            <label>Amount<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <input type="text" placeholder="$ 25.00" class="form-control" disabled />
                                        </div>
                                    </div>
                                    {/* <div class="row" style={{ paddingTop: "10px" }}>
                                        <div class="col-lg-6">
                                            <label>Expiration Date<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <input type="text" name="" placeholder="" class="form-control" />
                                        </div>
                                        <div class="col-lg-6">
                                            <label>Amount<span style={{ color: "#ffa12d" }}>*</span></label>
                                            <input type="text" name="" placeholder="" class="form-control" />
                                        </div>
                                    </div> */}
                                    <div class="row" style={{ paddingTop: "10px" }}>
                                        <div class="col-lg-12">
                                            <label>Set this profile as default  <span style={{ color: "#ffa12d" }}>- Error getting your card details*</span></label>
                                            <div class="switchToggle custom-control custom-switch">
                                                <input type="checkbox" class="custom-control-input" id="customSwitch11114" />
                                                <label class="custom-control-label" for="customSwitch11114">&nbsp;</label>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-12">
                                            <button onClick={() => OrderDomain()} type="button" class="next_btn border-0">Order Domain</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            {/* <div class="modal-footer">
                                <button type="button" class="btn btn-default" data-dismiss="">Save</button>
                            </div> */}
                        </div>
                    </div>
                </div>
            </div>

            <div class="agent_pop">
                <div id="Services" class="modal fade" role="dialog">
                    <div class="modal-dialog">
                        <div class="modal-content">
                            <div class="modal-header">
                                <button type="button" class="close" data-dismiss="modal">&times;</button>
                                <h4 class="modal-title">Service Links<i class="fas fa-link"></i></h4>
                            </div>
                            <div class="modal-body">
                                <div class="agent_pop_main">
                                    <div class="agent_pop_main_head">
                                        <h5>Branded Links</h5>
                                    </div>
                                    <div class="agent_pop_main_head" style={{ paddingTop: "15px" }}>
                                        <h5>MLS Links</h5>
                                    </div>
                                    <div class="agent_pop_main_head" style={{ paddingTop: "15px" }}>
                                        <h5>Email Links</h5>
                                        <p style={{ paddingTop: "10px" }}>You could enter multiple email addresses separated by comma.</p>
                                    </div>
                                    <div class="">
                                        <input type="text" name="" placeholder="Email" class="form-control" />
                                        <button type="button" class="next_btn">Send</button>
                                    </div>
                                </div>
                            </div>
                            <div class="modal-footer">
                                <button type="button" class="btn btn-default" data-dismiss="">Save</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>


            <div class="agent_pop">
                <div id="Traffic" class="modal fade" role="dialog">
                    <div class="modal-dialog">
                        <div class="modal-content">
                            <div class="modal-header">
                                <button type="button" class="close" data-dismiss="modal">&times;</button>
                                <h4 class="modal-title">Traffic Reports<i class="far fa-file-chart-pie"></i></h4>
                            </div>
                            <div class="modal-body">
                                <div class="agent_pop_main">
                                    <div class="agent_pop_main_head padd_top">
                                        <h5>Email Recipients (comma seperated)</h5>
                                    </div>
                                    <p class="padd_top">You could enter multiple email addresses separated by commas.</p>
                                    <div class="service_links">
                                        <div class="row">
                                            <div class="col-lg-3 col-md-3">
                                                <div class="service_links_left">
                                                    <h6>To:</h6>
                                                </div>
                                            </div>
                                            <div class="col-lg-9 col-md-9">
                                                <div class="service_links_right">
                                                    <input type="text" name="" class="form-control" value={currentUser && currentUser.email} />
                                                    <div class="d-flex">
                                                        <button onClick={handleReport} type="button" class="next_btn">View Report</button>
                                                        <button type="button" class="next_btn grey email_btn">Send Email</button>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    <div class="agent_pop_main_head padd_top">
                                        <h5>Auto Forward</h5>
                                    </div>
                                    <div class="service_links">
                                        <div class="row padd_top">
                                            <div class="col-lg-3 col-md-3">
                                                <div class="service_links_left">
                                                    <h6>Email report every week:</h6>
                                                </div>
                                            </div>
                                            <div class="col-lg-9 col-md-9">
                                                <div class="service_links_right">
                                                    <div class="switchToggle custom-control custom-switch">
                                                        <input type="checkbox" class="custom-control-input" id="customSwitch333" checked="" />
                                                        <label class="custom-control-label" for="customSwitch333">&nbsp;</label>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="modal-footer">
                                <button type="button" class="btn btn-default" data-dismiss="">Save</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div class="agent_pop">
                <div id="Domain_Manager" class="modal fade" role="dialog">
                    <div class="modal-dialog">
                        <div class="modal-content">
                            <div class="modal-header">
                                <button type="button" class="close" data-dismiss="modal">&times;</button>
                                <h4 class="modal-title">Domain Manager List<i class="fas fa-video"></i></h4>
                            </div>
                            <div class="modal-body">
                                <table style={{ width: "100%", fontSize: "12px" }} class="table table-bordered">
                                    <thead>
                                        <tr>
                                            <td style={{ fontSize: "12px" }}>Sl.no</td>
                                            <td style={{ fontSize: "12px" }}>CreatedAt</td>
                                            <td style={{ fontSize: "12px" }}>Domain</td>
                                            <td style={{ fontSize: "12px" }}>DomainId</td>
                                            <td style={{ fontSize: "12px" }}>expires</td>
                                            <td style={{ fontSize: "12px" }}>Renew Deadline</td>
                                            <td style={{ fontSize: "12px" }}>Status</td>
                                            {/* <td style={{fontSize:"12px"}}>Actions</td> */}
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {domainData.length > 0 ? (
                                            domainData.map((res, index) => (
                                                <tr>
                                                    <td style={{ fontSize: "12px" }}>{index + 1}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.createdAt}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.domain}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.domainId}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.expires}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.renewDeadline}</td>
                                                    <td style={{ fontSize: "12px" }}>{res.status}</td>
                                                    {/* <td style={{fontSize:"12px",width:"100",textAlign:"center"}}>
                                                        <span style={{}}><i class="far fa-trash-alt"></i></span></td> */}
                                                </tr>
                                            ))
                                        ) : (
                                            ""
                                        )}
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <Snackbar anchorOrigin={{ vertical: "top", horizontal: "right" }} open={openWarning} autoHideDuration={3000} onClose={handleClose}>
                <Alert onClose={handleClose} severity="warning">
                    {message}
                </Alert>
            </Snackbar>
            <Snackbar anchorOrigin={{ vertical: "top", horizontal: "right" }} open={openSuccess} autoHideDuration={3000} onClose={handleClose}>
                <Alert onClose={handleClose} severity="success">
                    {message}
                </Alert>
            </Snackbar>
            <Snackbar anchorOrigin={{ vertical: "top", horizontal: "right" }} open={openError} autoHideDuration={3000} onClose={handleClose}>
                <Alert onClose={handleClose} severity="error">
                    {message}
                </Alert>
            </Snackbar>
            <Backdrop className={classes.backdrop} open={open}>
                <CircularProgress color="inherit" />
            </Backdrop>
        </div >
    )
}
